	["100105_1"] = { id = 100105, level = 1, desc_info = {{ [2] = "出现<color=#e89e1d>黄色预警</color>时，该次攻击可被<color=#e89e1d>弹反</color>。\n在被攻击之前按下<color=#e89e1d>攻击按钮</color>可触发。\n弹反能够<color=#e89e1d>打断</color>敌人技能、积累敌方弱点槽、增加角色日相。",},}, fight_marks = {99100105,},},
	["100106_1"] = { id = 100106, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>普通预警</color>时，该次攻击可被<color=#e06a02>闪避</color>。\n在该次攻击前按下<color=#e06a02>闪避按钮</color>可闪避本次攻击。\n成功闪避可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},}, fight_marks = {99100106,},},
	["100107_1"] = { id = 100107, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>圆形预警</color>时，该次攻击可被<color=#e06a02>跳跃闪避</color>。\n在被攻击之前按下<color=#e06a02>跳跃按钮</color>可触发<color=#e06a02>跳跃闪避</color>，并可释放<color=#e06a02>跳跃反击</color>。\n<color=#e06a02>跳跃反击</color>能够对敌人造成大量伤害，并可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},}, fight_marks = {99100107,},},
	["100108_1"] = { id = 100108, level = 1, desc_info = {{"绝技点数","<color=#e06a02>弱点槽</color>：<color=#e06a02>除五行绝技外</color>大多数攻击命中时，都可以<color=#e06a02>不同程度地</color>积累敌人的弱点槽。当敌人的弱点槽满时，敌人将进入<color=#e06a02>五行击破</color>状态，并且我方队伍会获得<color=#e06a02>1</color>点<color=#b52e20>绝技点数</color>。\n<color=#e06a02>绝技点数</color>：<color=#e06a02>绝技点数</color>是一种<color=#e06a02>全队共享</color>的资源。可以通过<color=#e06a02>积累满敌人的弱点槽/击败敌人</color>使队伍获得绝技点数，最多可积攒<color=#e06a02>3</color>点绝技点数。队伍中的角色可以通过消耗绝技点数，释放五行绝技。",},{"日相","<color=#e06a02>获得日相</color>：<color=#e06a02>角色普攻命中/位于队伍后台/处于非战斗状态下</color>将逐渐恢复日相；<color=#e06a02>闪避/跳跃反击</color>成功时，将直接获得<color=#e06a02>1</color>格日相。最多可积攒<color=#e06a02>3</color>格日相。\n<color=#e06a02>失衡</color>：被敌人命中时，将损失一定<color=#e06a02>日相</color>。",},{"月相","<color=#e06a02>获得月相</color>：角色<color=#e06a02>闪避/跳跃反击</color>成功时，获得<color=#e06a02>1</color>格月相；最多可积攒<color=#e06a02>3</color>格月相。月相可用于释放<color=#e06a02>月灵技能</color>。",},}, fight_marks = {99100108,},},
	["100109_1"] = { id = 100109, level = 1, desc_info = {{ [2] = "青乌火属性伤害加成提升30%。\n青乌火焰的根源来源于某份契约，正因那份契约，就算是余烬也能如此自由行走于大地之上。",},},},
	["100151_1"] = { id = 100151, level = 1, desc_info = {{ [2] = "无用，因为1脉是解锁核心被动",},},},
	["100152_1"] = { id = 100152, level = 1, desc_info = {{ [2] = "火属性伤害+10%。",},}, fight_attrs = {{63,1000,},},},
	["100153_1"] = { id = 100153, level = 1, desc_info = {{ [2] = "[五行绝技-坠火踏破]的总伤害倍率提升15%。",},}, fight_marks = {10011003,},},
	["100154_1"] = { id = 100154, level = 1, desc_info = {{ [2] = "解锁青乌的空中连携能力。",},}, fight_marks = {10011004,},},
	["100155_1"] = { id = 100155, level = 1, desc_info = {{ [2] = "释放[五行绝技-坠火踏破]后回复1格日相。",},}, fight_marks = {10011005,},},
	["100156_1"] = { id = 100156, level = 1, desc_info = {{ [2] = "青乌处于后台时，每格炎印额外提升10%日相回复效率。",},}, fight_marks = {10011006,},},
	["100201_1"] = { id = 100201, level = 1, desc_attr = {{"一段伤害","84.8%",},{"二段伤害","66.7%+90.9%",},{"三段伤害","66.7%",},{"四段伤害","42.4%",},{"五段伤害","84.9%+115.2%",},{"瞄准射击","90.9%",},{"蓄力射击","303.0%",},{"下落攻击","133.3%",},}, desc_info = {{"普通攻击","进行至多<color=#e06a02>五段</color>的攻击，通过射击和体术造成金属性伤害。\n\n<i>来来的战斗理念在于实用，射击无特别章法，故称自由。<I>",},{"蓄力攻击","<color=#e06a02>长按</color>攻击按钮时，将进入<color=#e06a02>瞄准状态</color>。瞄准时，视角将发生变化，视野中将出现<color=#e06a02>准心</color>并可以发动<color=#e06a02>瞄准射击</color>。\n在<color=#e06a02>瞄准状态</color>下，来来会持续在枪口聚集能量；在蓄力完成后，可以发动更为强力的<color=#e06a02>蓄力射击</color>。",},{"怪物弱点","敌人拥有各自的<color=#e06a02>弱点</color>。攻击命中敌人的弱点时，将<color=#e06a02>打断</color>敌人的攻击，并造成高额伤害。",},},},
