	["100203_1"] = { id = 100203, level = 1, desc_attr = {{"雷棱伤害","55.5%",},{"冷却时间","25秒",},}, desc_info = {{ [2] = "来来凝聚周遭的雷电之势，召唤绶印闪雷。存在期间内，会持续锁定附近的敌人，降下雷棱打击敌人，造成小范围金属性伤害。\n\n<i>这是来来在离开宗门之前，从师傅手上获得的绶印，以此弥补自己不成器的能力。<i>",},{"绝技点数","<color=#e06a02>弱点槽</color>：<color=#e06a02>除五行绝技外</color>大多数攻击命中时，都可以<color=#e06a02>不同程度地</color>积累敌人的弱点槽。当敌人的弱点槽满时，敌人将进入<color=#e06a02>五行击破</color>状态，并且我方队伍会获得<color=#e06a02>1</color>点<color=#b52e20>绝技点数</color>。\n<color=#e06a02>绝技点数</color>：<color=#e06a02>绝技点数</color>是一种<color=#e06a02>全队共享</color>的资源。可以通过<color=#e06a02>积累满敌人的弱点槽/击败敌人</color>使队伍获得绝技点数，最多可积攒<color=#e06a02>3</color>点绝技点数。队伍中的角色可以通过消耗绝技点数，释放五行绝技。",},},},
