	["100204_1"] = { id = 100204, level = 1, desc_attr = {{"移动射击伤害","81.0%",},}, desc_info = {{"核心充能","来来普攻的<color=#e06a02>特定几段攻击</color>（后踢、滑铲、瞬身开枪、普攻最后一击）命中时，会为她的双枪暖机，积攒<color=#e06a02>核心充能</color>。当<color=#e06a02>核心充能</color>充满时，可以释放<color=#b52e20>核心技能</color>。",},{"核心技能","当<color=#e06a02>核心充能</color>充满时，<color=#e06a02>长按</color>攻击按钮将进入<color=#e06a02>核心状态</color>。核心状态下，<color=#e06a02>蓄力射击</color>将被<color=#e06a02>移动射击</color>替代，可以在瞄准射击的同时控制人物移动。<color=#e06a02>移动射击</color>期间将持续消耗<color=#e06a02>核心充能</color>。在<color=#e06a02>核心充能</color>消耗完或者一段时间后，会结束<color=#e06a02>核心状态</color>。",},},},
