	["100204_9"] = { id = 100204, level = 9, desc_attr = {{"移动射击伤害","116.1%",},}, desc_info = {{"核心充能","来来普攻的<color=#e06a02>特定几段攻击</color>（后踢、滑铲、瞬身开枪、普攻最后一击）命中时，会为她的双枪暖机，积攒<color=#e06a02>核心充能</color>。当<color=#e06a02>核心充能</color>充满时，可以释放<color=#b52e20>核心技能</color>。",},{"核心技能","当<color=#e06a02>核心充能</color>充满时，<color=#e06a02>长按</color>攻击按钮将进入<color=#e06a02>核心状态</color>。核心状态下，<color=#e06a02>蓄力射击</color>将被<color=#e06a02>移动射击</color>替代，可以在瞄准射击的同时控制人物移动。<color=#e06a02>移动射击</color>期间将持续消耗<color=#e06a02>核心充能</color>。在<color=#e06a02>核心充能</color>消耗完或者一段时间后，会结束<color=#e06a02>核心状态</color>。",},}, need_gold = 198000, need_item = {{20323,5,},{30132,6,},},},
	["100205_1"] = { id = 100205, level = 1, desc_info = {{"长按攻击","<color=#e06a02>长按</color>攻击按钮时，将进入<color=#b52e20>瞄准状态</color>并持续在枪口聚集雷电之势，发动<color=#b52e20>蓄力射击</color>。瞄准时，视角将发生变化，视野中将出现<color=#e06a02>准心</color>。",},{"怪物弱点","部分敌人拥有<color=#b52e20>弱点</color>。攻击敌人的弱点，将<color=#e06a02>打断</color>怪物技能，并造成高额伤害。",},},},
	["100206_1"] = { id = 100206, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>普通预警</color>时，该次攻击可被<color=#e06a02>闪避</color>。\n在该次攻击前按下<color=#e06a02>闪避按钮</color>可闪避本次攻击。\n成功闪避可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100207_1"] = { id = 100207, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>圆形预警</color>时，该次攻击可被<color=#e06a02>跳跃闪避</color>。\n在被攻击之前按下<color=#e06a02>跳跃按钮</color>可触发<color=#e06a02>跳跃闪避</color>，并可释放<color=#e06a02>跳跃反击</color>。\n<color=#e06a02>跳跃反击</color>能够对敌人造成大量伤害，并可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100208_1"] = { id = 100208, level = 1, desc_info = {{"绝技点数","<color=#e06a02>弱点槽</color>：<color=#e06a02>除五行绝技外</color>大多数攻击命中时，都可以<color=#e06a02>不同程度地</color>积累敌人的弱点槽。当敌人的弱点槽满时，敌人将进入<color=#e06a02>五行击破</color>状态，并且我方队伍会获得<color=#e06a02>1</color>点<color=#b52e20>绝技点数</color>。\n<color=#e06a02>绝技点数</color>：<color=#e06a02>绝技点数</color>是一种<color=#e06a02>全队共享</color>的资源。可以通过<color=#e06a02>积累满敌人的弱点槽/击败敌人</color>使队伍获得绝技点数，最多可积攒<color=#e06a02>3</color>点绝技点数。队伍中的角色可以通过消耗绝技点数，释放五行绝技。",},{"日相","<color=#e06a02>获得日相</color>：<color=#e06a02>角色普攻命中/位于队伍后台/处于非战斗状态下</color>将逐渐恢复日相；<color=#e06a02>闪避/跳跃反击</color>成功时，将直接获得<color=#e06a02>1</color>格日相。最多可积攒<color=#e06a02>3</color>格日相。\n<color=#e06a02>失衡</color>：被敌人命中时，将损失一定<color=#e06a02>日相</color>。",},{"月相","<color=#e06a02>获得月相</color>：角色<color=#e06a02>闪避/跳跃反击</color>成功时，获得<color=#e06a02>1</color>格月相；最多可积攒<color=#e06a02>3</color>格月相。月相可用于释放<color=#e06a02>月灵技能</color>。",},},},
	["100209_1"] = { id = 100209, level = 1, desc_info = {{ [2] = "强化后的特技可以产生范围伤害，对目标周围3米的单位造成金属性伤害。\n加入宗门却没有完成授业，早早收拾包袱离开的人都会被称作浪徒，刻刻就是这些人中的其中之一。",},},},
	["100251_1"] = { id = 100251, level = 1, desc_info = {{ [2] = "瞄准射击可以自动吸附敌人，并且高亮显示敌人弱点。",},}, fight_marks = {10021001,},},
	["100252_1"] = { id = 100252, level = 1, desc_info = {{ [2] = "金属性伤害+10%。",},}, fight_attrs = {{54,1000,},},},
	["100253_1"] = { id = 100253, level = 1, desc_info = {{ [2] = "解锁刻刻的闪避反击能力，极限闪避成功后衔接普攻，可以进行反击，并且获得10点核心被动能量。",},}, fight_marks = {10021003,},},
	["100254_1"] = { id = 100254, level = 1, desc_info = {{ [2] = "[特技-闪灵乱击]伤害倍率提升15%。",},}, fight_marks = {10021004,},},
	["100255_1"] = { id = 100255, level = 1, desc_info = {{ [2] = "[特技-闪灵乱击]现在可以对目标以外的范围敌人造成金属性伤害，伤害为目标的所受伤害的30%。",},}, fight_marks = {10021005,},},
	["100256_1"] = { id = 100256, level = 1, desc_info = {{ [2] = "刻刻在核心被动激活状态下，会激活霸体效果，期间受到的所有伤害-10%，移动射击伤害+25%。",},}, fight_marks = {10021006,},},
