	["100503_1"] = { id = 100503, level = 1, desc_attr = {{"横扫伤害","848.5%",},{"分身伤害","236.4%",},{"冷却时间","28秒",},}, desc_info = {{ [2] = "义向吸收天地精华并进入<color=#b52e20>乾坤状态</color>，随后朝前方施展一次大范围的挥打攻击，造成土属性伤害。",},{"乾坤状态","义向在<color=#e06a02>乾坤状态</color>下，<color=#e06a02>普通攻击/特技的反击攻击/五行绝技的横扫</color>命中敌方目标，或成功<color=#e06a02>闪避</color>敌方目标的攻击时，会在目标的附近召唤一定数量的<color=#e06a02>分身</color>攻击目标，造成土属性伤害。<color=#e06a02>乾坤状态</color>持续<color=#e06a02>10</color>秒。\n\n<i>压制自身，然后成义，遵守师傅的教导，义向学会了压制自身，放出他我的绝招。<i>",},{"绝技点数","<color=#e06a02>弱点槽</color>：<color=#e06a02>除五行绝技外</color>大多数攻击命中时，都可以<color=#e06a02>不同程度地</color>积累敌人的弱点槽。当敌人的弱点槽满时，敌人将进入<color=#e06a02>五行击破</color>状态，并且我方队伍会获得<color=#e06a02>1</color>点<color=#b52e20>绝技点数</color>。\n<color=#e06a02>绝技点数</color>：<color=#e06a02>绝技点数</color>是一种<color=#e06a02>全队共享</color>的资源。可以通过<color=#e06a02>积累满敌人的弱点槽/击败敌人</color>使队伍获得绝技点数，最多可积攒<color=#e06a02>3</color>点绝技点数。队伍中的角色可以通过消耗绝技点数，释放五行绝技。",},},},
