	["100505_1"] = { id = 100505, level = 1, desc_info = {{"长按","<color=#e89e1d>长按</color>攻击按钮时，将进行蓄力，雷电之势持续在枪口聚集。",},},},
	["100506_1"] = { id = 100506, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>普通预警</color>时，该次攻击可被<color=#e06a02>闪避</color>。\n在该次攻击前按下<color=#e06a02>闪避按钮</color>可闪避本次攻击。\n成功闪避可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100507_1"] = { id = 100507, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>圆形预警</color>时，该次攻击可被<color=#e06a02>跳跃闪避</color>。\n在被攻击之前按下<color=#e06a02>跳跃按钮</color>可触发<color=#e06a02>跳跃闪避</color>，并可释放<color=#e06a02>跳跃反击</color>。\n<color=#e06a02>跳跃反击</color>能够对敌人造成大量伤害，并可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100508_1"] = { id = 100508, level = 1, desc_info = {{"绝技点数","<color=#e06a02>弱点槽</color>：<color=#e06a02>除五行绝技外</color>大多数攻击命中时，都可以<color=#e06a02>不同程度地</color>积累敌人的弱点槽。当敌人的弱点槽满时，敌人将进入<color=#e06a02>五行击破</color>状态，并且我方队伍会获得<color=#e06a02>1</color>点<color=#b52e20>绝技点数</color>。\n<color=#e06a02>绝技点数</color>：<color=#e06a02>绝技点数</color>是一种<color=#e06a02>全队共享</color>的资源。可以通过<color=#e06a02>积累满敌人的弱点槽/击败敌人</color>使队伍获得绝技点数，最多可积攒<color=#e06a02>3</color>点绝技点数。队伍中的角色可以通过消耗绝技点数，释放五行绝技。",},{"日相","<color=#e06a02>获得日相</color>：<color=#e06a02>角色普攻命中/位于队伍后台/处于非战斗状态下</color>将逐渐恢复日相；<color=#e06a02>闪避/跳跃反击</color>成功时，将直接获得<color=#e06a02>1</color>格日相。最多可积攒<color=#e06a02>3</color>格日相。\n<color=#e06a02>失衡</color>：被敌人命中时，将损失一定<color=#e06a02>日相</color>。",},{"月相","<color=#e06a02>获得月相</color>：角色<color=#e06a02>闪避/跳跃反击</color>成功时，获得<color=#e06a02>1</color>格月相；最多可积攒<color=#e06a02>3</color>格月相。月相可用于释放<color=#e06a02>月灵技能</color>。",},},},
	["100509_1"] = { id = 100509, level = 1, desc_info = {{ [2] = "土属性伤害加成提升30%。\n师傅的教导挥之不去，在脑中缠绕，仿若金箍，让义向时刻保持紧张的状态。",},},},
	["100551_1"] = { id = 100551, level = 1, desc_info = {{ [2] = "分身伤害提升10%，普攻变为土属性攻击伤害。",},}, fight_marks = {10051001,},},
	["100552_1"] = { id = 100552, level = 1, desc_info = {{ [2] = "乾坤状态下义向获得10%土属性伤害加成。",},}, fight_marks = {10051002,},},
	["100553_1"] = { id = 100553, level = 1, desc_info = {{ [2] = "[特技-禹步]伤害倍率提升10%。",},}, fight_marks = {10051003,},},
	["100554_1"] = { id = 100554, level = 1, desc_info = {{ [2] = "成功闪避或者反击后，可以召唤一个分身攻击敌人。在反击后，还可以额外回复一格日相。",},}, fight_marks = {10051004,},},
	["100555_1"] = { id = 100555, level = 1, desc_info = {{ [2] = "[核心被动-法身·义]造成的伤害提高25%。",},}, fight_marks = {10051005,},},
	["100556_1"] = { id = 100556, level = 1, desc_info = {{ [2] = "乾坤状态下，义向的五行击破效率提升10%，大招持续时间+4秒。",},}, fight_marks = {10051006,},},
