	["100602_1"] = { id = 100602, level = 1, desc_attr = {{"绫罗礼·一段伤害","3.51%生命值上限",},{"绫罗礼·二段伤害","19.3%+22.8%生命值上限",},{"绫罗礼·三段伤害","15.8%+42.1%+4.21%生命值上限",},{"冷却时间","无冷却",},}, desc_info = {{ [2] = "青门隐消耗<color=#e06a02>1</color>格<color=#b52e20>日相能量</color>，施展<color=#e06a02>绫罗礼</color>，对敌人造成木属性伤害。<color=#e06a02>连续释放</color>时，青门隐会改变绫罗礼的舞步形态。绫罗礼总共有三段舞步。",},{"第一段","青门隐在空中舞蹈，拂动长袖席卷风花攻击敌人。",},{"第二段","青门隐将风花敛入袖中后拂向敌人，而后踢散地面落花并拉开与敌人距离。",},{"第三段","青门隐在敌人脚下召出花藤将其禁锢，将花瓣化为蝴蝶，驱使其攻击敌人。\n\n<i>青门隐根据传承改进的祝舞，就除祸的方向来说并没有变强多少，但却十分适合隐的身高。<i>",},{"日相","<color=#e06a02>获得日相</color>：<color=#e06a02>角色普攻命中/位于队伍后台/处于非战斗状态下</color>将逐渐恢复日相；<color=#e06a02>闪避/跳跃反击</color>成功时，将直接获得<color=#e06a02>1</color>格日相。最多可积攒<color=#e06a02>3</color>格日相。\n<color=#e06a02>失衡</color>：被敌人命中时，将损失一定<color=#e06a02>日相</color>。",},},},
