	["100604_9"] = { id = 100604, level = 9, desc_attr = {{"治疗效果","11.9%生命值上限+2649",},{"核心伤害","133.2%生命值上限",},}, desc_info = {{"核心充能","青门隐每次释放特技，都会积累<color=#e06a02>1</color>层<color=#e06a02>核心充能</color>，最多积累<color=#e06a02>3</color>层。核心充能满3层时，<color=#e06a02>长按</color>攻击按钮可以释放<color=#b52e20>核心技能</color>。",},{"核心技能","青门隐释放法器中积攒的能量，对周围的敌人造成木属性伤害，并<color=#e06a02>治疗全队角色</color>。随后青门隐会进入持续<color=#e06a02>12</color>秒的<color=#e06a02>核心状态</color>，持续时间内青门隐获得<color=#e06a02>10%</color>的伤害减免。\n\n<i>隐并不常助人，但她在任何时候都会留着能助人的一手，有一说是因为她的身份，有一说则是因为她在谋划着什么算盘。<i>",},}, need_gold = 198000, need_item = {{20333,5,},{30142,6,},},},
	["100605_1"] = { id = 100605, level = 1, desc_info = {{"长按","<color=#e89e1d>长按</color>攻击按钮时，将进行蓄力，雷电之势持续在枪口聚集。",},},},
	["100606_1"] = { id = 100606, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>普通预警</color>时，该次攻击可被<color=#e06a02>闪避</color>。\n在该次攻击前按下<color=#e06a02>闪避按钮</color>可闪避本次攻击。\n成功闪避可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100607_1"] = { id = 100607, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>圆形预警</color>时，该次攻击可被<color=#e06a02>跳跃闪避</color>。\n在被攻击之前按下<color=#e06a02>跳跃按钮</color>可触发<color=#e06a02>跳跃闪避</color>，并可释放<color=#e06a02>跳跃反击</color>。\n<color=#e06a02>跳跃反击</color>能够对敌人造成大量伤害，并可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100608_1"] = { id = 100608, level = 1, desc_info = {{"绝技点数","<color=#e06a02>弱点槽</color>：<color=#e06a02>除五行绝技外</color>大多数攻击命中时，都可以<color=#e06a02>不同程度地</color>积累敌人的弱点槽。当敌人的弱点槽满时，敌人将进入<color=#e06a02>五行击破</color>状态，并且我方队伍会获得<color=#e06a02>1</color>点<color=#b52e20>绝技点数</color>。\n<color=#e06a02>绝技点数</color>：<color=#e06a02>绝技点数</color>是一种<color=#e06a02>全队共享</color>的资源。可以通过<color=#e06a02>积累满敌人的弱点槽/击败敌人</color>使队伍获得绝技点数，最多可积攒<color=#e06a02>3</color>点绝技点数。队伍中的角色可以通过消耗绝技点数，释放五行绝技。",},{"日相","<color=#e06a02>获得日相</color>：<color=#e06a02>角色普攻命中/位于队伍后台/处于非战斗状态下</color>将逐渐恢复日相；<color=#e06a02>闪避/跳跃反击</color>成功时，将直接获得<color=#e06a02>1</color>格日相。最多可积攒<color=#e06a02>3</color>格日相。\n<color=#e06a02>失衡</color>：被敌人命中时，将损失一定<color=#e06a02>日相</color>。",},{"月相","<color=#e06a02>获得月相</color>：角色<color=#e06a02>闪避/跳跃反击</color>成功时，获得<color=#e06a02>1</color>格月相；最多可积攒<color=#e06a02>3</color>格月相。月相可用于释放<color=#e06a02>月灵技能</color>。",},},},
	["100651_1"] = { id = 100651, level = 1, desc_info = {{ [2] = "释放[特技-绫罗礼]期间，青门隐获得霸体状态，且闪避不会中断技能连击段数累积。",},}, fight_marks = {10061001,},},
	["100652_1"] = { id = 100652, level = 1, desc_info = {{ [2] = "核心状态下，队伍其他成员也可享受到减伤效果。当队伍中有角色触发极限闪避后，青门会获得3层核心被动，这个效果有18s冷却。",},}, fight_marks = {10061002,},},
	["100653_1"] = { id = 100653, level = 1, desc_info = {{ [2] = "青门隐每拥有1%的治疗加成，能使[特技-绫罗礼]的暴击率提高0.5%。",},}, fight_marks = {10061003,},},
	["100654_1"] = { id = 100654, level = 1, desc_info = {{ [2] = "处于绝技领域中，青门隐受到绝技的治疗会额外回复1格日相。绝技的总治疗倍率提升10%。",},}, fight_marks = {10061004,},},
	["100655_1"] = { id = 100655, level = 1, desc_info = {{ [2] = "[特技-绫罗礼]第三段会额外造成一次相当于青门隐生命值上限100%的伤害，并为所有队伍中角色提供青门隐生命值上限10%的治疗效果。这个伤害视作[特技-绫罗礼]的伤害。",},}, fight_marks = {10061005,10061007,},},
	["100656_1"] = { id = 100656, level = 1, desc_info = {{ [2] = "核心状态下，在青门隐为队伍中角色提供治疗后，使[特技-绫罗礼]获得120%暴击伤害加成，持续3秒。",},}, fight_marks = {10061006,},},
	["100701_1"] = { id = 100701, level = 1, desc_attr = {{"一段伤害","97.0%",},{"二段伤害","36.4%+145.5%",},{"三段伤害","97.0%",},{"四段伤害","33.3%",},{"五段伤害","218.2%",},{"下落攻击","145.5%",},}, desc_info = {{"普通攻击","追识使用机关伞类武器，发起至多<color=#e06a02>五段</color>攻击，造成物理伤害和火属性伤害。\n\n<i>伞的用法其实与长刀相似，追识善用了自己学习的技术，即便是伞也能挥出斩风。<i>",},},},
