	["100703_1"] = { id = 100703, level = 1, desc_attr = {{"技能伤害","1454.5%",},{"法阵增伤","10.0%",},{"冷却时间","20秒",},}, desc_info = {{ [2] = "追识跃向空中，召唤仙鹤围绕其身，随后与仙鹤一同向目标处突进，造成大量火属性伤害，并在地面生成一个持续<color=#e06a02>10</color>秒的<color=#e06a02>法阵</color>。处于<color=#e06a02>法阵</color>中的角色会获得<color=#e06a02>10%</color>的<color=#e06a02>伤害加成</color>效果。\n\n<i>宁王塔藏书中纪录的一招，据传是初代天月城封侯宁王所用，追识幼时基本都在宁王塔中玩耍，读遍了里面的书物。<i>",},{"绝技点数","<color=#e06a02>弱点槽</color>：<color=#e06a02>除五行绝技外</color>大多数攻击命中时，都可以<color=#e06a02>不同程度地</color>积累敌人的弱点槽。当敌人的弱点槽满时，敌人将进入<color=#e06a02>五行击破</color>状态，并且我方队伍会获得<color=#e06a02>1</color>点<color=#b52e20>绝技点数</color>。\n<color=#e06a02>绝技点数</color>：<color=#e06a02>绝技点数</color>是一种<color=#e06a02>全队共享</color>的资源。可以通过<color=#e06a02>积累满敌人的弱点槽/击败敌人</color>使队伍获得绝技点数，最多可积攒<color=#e06a02>3</color>点绝技点数。队伍中的角色可以通过消耗绝技点数，释放五行绝技。",},},},
