	["100704_1"] = { id = 100704, level = 1, desc_attr = {{"持续伤害","66.7%",},{"挥击伤害","363.6%",},}, desc_info = {{"核心充能","追识的<color=#e06a02>普通攻击和绝技</color>在命中时，都会获得<color=#e06a02>一定数量</color>的<color=#e06a02>伞舞值</color>。<color=#e06a02>伞舞值</color>积累满时，可以<color=#e06a02>长按</color>攻击按钮，释放<color=#b52e20>核心技能</color>。",},{"核心技能","追识<color=#e06a02>持续引导</color>机关伞旋转击打当前的目标，造成高频率的火属性伤害。\n在伞舞值消耗完或松开攻击按钮时，追识会结束引导状态，并将伞拾起向目标发动一次<color=#e06a02>挥击</color>，造成物理伤害。\n维持引导状态和释放挥击都会消耗一定的伞舞值。在伞舞值消耗完之前，追识可以重新<color=#e06a02>长按</color>攻击按钮再次进入引导状态。\n\n<i>在实战后经由追识自主开发的招式，发挥了伞作为奇兵的特长，出其不意。<i>",},},},
