	["100704_9"] = { id = 100704, level = 9, desc_attr = {{"持续伤害","95.6%",},{"突进伤害","521.2%",},}, desc_info = {{"核心充能","追识的<color=#e06a02>普通攻击和绝技</color>在命中时，都会获得<color=#e06a02>一定数量</color>的<color=#e06a02>伞舞值</color>。<color=#e06a02>伞舞值</color>积累满时，可以<color=#e06a02>长按</color>攻击按钮，释放<color=#b52e20>核心技能</color>。",},{"核心技能","追识<color=#e06a02>持续引导</color>机关伞旋转击打当前的目标，造成高频率的火属性伤害。\n在伞舞值消耗完或松开攻击按钮时，追识会结束引导状态，并将伞拾起向目标发动一次<color=#e06a02>挥击</color>，造成物理伤害。\n维持引导状态和释放挥击都会消耗一定的伞舞值。在伞舞值消耗完之前，追识可以重新<color=#e06a02>长按</color>攻击按钮再次进入引导状态。\n\n<i>在实战后经由追识自主开发的招式，发挥了伞作为奇兵的特长，出其不意。<i>",},}, need_gold = 198000, need_item = {{20353,5,},{30152,6,},},},
	["100705_1"] = { id = 100705, level = 1, desc_info = {{"长按","<color=#e89e1d>长按</color>攻击按钮时，将进行蓄力，雷电之势持续在枪口聚集。",},},},
	["100706_1"] = { id = 100706, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>普通预警</color>时，该次攻击可被<color=#e06a02>闪避</color>。\n在该次攻击前按下<color=#e06a02>闪避按钮</color>可闪避本次攻击。\n成功闪避可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100707_1"] = { id = 100707, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>圆形预警</color>时，该次攻击可被<color=#e06a02>跳跃闪避</color>。\n在被攻击之前按下<color=#e06a02>跳跃按钮</color>可触发<color=#e06a02>跳跃闪避</color>，并可释放<color=#e06a02>跳跃反击</color>。\n<color=#e06a02>跳跃反击</color>能够对敌人造成大量伤害，并可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100708_1"] = { id = 100708, level = 1, desc_info = {{"绝技点数","<color=#e06a02>弱点槽</color>：<color=#e06a02>除五行绝技外</color>大多数攻击命中时，都可以<color=#e06a02>不同程度地</color>积累敌人的弱点槽。当敌人的弱点槽满时，敌人将进入<color=#e06a02>五行击破</color>状态，并且我方队伍会获得<color=#e06a02>1</color>点<color=#b52e20>绝技点数</color>。\n<color=#e06a02>绝技点数</color>：<color=#e06a02>绝技点数</color>是一种<color=#e06a02>全队共享</color>的资源。可以通过<color=#e06a02>积累满敌人的弱点槽/击败敌人</color>使队伍获得绝技点数，最多可积攒<color=#e06a02>3</color>点绝技点数。队伍中的角色可以通过消耗绝技点数，释放五行绝技。",},{"日相","<color=#e06a02>获得日相</color>：<color=#e06a02>角色普攻命中/位于队伍后台/处于非战斗状态下</color>将逐渐恢复日相；<color=#e06a02>闪避/跳跃反击</color>成功时，将直接获得<color=#e06a02>1</color>格日相。最多可积攒<color=#e06a02>3</color>格日相。\n<color=#e06a02>失衡</color>：被敌人命中时，将损失一定<color=#e06a02>日相</color>。",},{"月相","<color=#e06a02>获得月相</color>：角色<color=#e06a02>闪避/跳跃反击</color>成功时，获得<color=#e06a02>1</color>格月相；最多可积攒<color=#e06a02>3</color>格月相。月相可用于释放<color=#e06a02>月灵技能</color>。",},},},
	["100709_1"] = { id = 100709, level = 1, desc_info = {{ [2] = "追识火属性伤害加成提升30%。\n追识之所以战斗，是为了报答。",},},},
	["100751_1"] = { id = 100751, level = 1, desc_info = {{ [2] = "追识在后台时，出战角色被控制状态下也可以切换追识上场，此时追识会解除当前角色的控制效果并释放[特技-伞术·无依]。",},}, fight_marks = {10071001,},},
	["100752_1"] = { id = 100752, level = 1, desc_info = {{ [2] = "伞舞值积攒速度提升40%。",},}, fight_marks = {10071002,},},
	["100753_1"] = { id = 100753, level = 1, desc_info = {{ [2] = "「五行绝技-宁王治术·落鹤」的总伤害倍率提升15%。",},}, fight_marks = {10071003,},},
	["100754_1"] = { id = 100754, level = 1, desc_info = {{ [2] = "「五行绝技-宁王治术·落鹤」产生的法阵增伤效果提升至15%，并且对处于法阵的敌人每秒共造成相当于攻击力100%的火属性伤害。",},}, fight_marks = {10071004,},},
	["100755_1"] = { id = 100755, level = 1, desc_info = {{ [2] = "追识成功解除队伍中角色控制效果时，会获得2格日相。",},}, fight_marks = {10071005,},},
	["100756_1"] = { id = 100756, level = 1, desc_info = {{ [2] = "追识释放[核心被动-鹤斩连环]需求的伞舞值降低至70%。并且[核心被动-鹤斩连环]的旋转速度提高50%。",},}, fight_marks = {10071006,},},
