	["100804_9"] = { id = 100804, level = 9, desc_attr = {{"有风能伤害","278.0%",},{"无风能伤害","34.7%",},}, desc_info = {{"核心充能","天狐恋以<color=#e06a02>普通攻击的扔扇回旋、风涌/绝技</color>命中目标时，会获得一定数量的<color=#e06a02>核心充能</color>。\n积累满时，可通过<color=#e06a02>长按</color>攻击按钮，使天狐恋扔出双扇，进入持续<color=#e06a02>12</color>秒的<color=#b52e20>核心状态</color>。\n另外，当天狐恋处于<color=#e06a02>队伍后台</color>时，若核心充能低于<color=#e06a02>70%</color>，每秒会获得<color=#e06a02>5%</color>的<color=#e06a02>核心充能</color>。",},{"核心技能","核心状态期间，天狐恋双扇在空中反复回旋，并优先<color=#e06a02>追踪并攻击</color>最接近天狐恋的目标。\n当扇子命中时敌人时，会消耗<color=#e06a02>1</color>格<color=#e06a02>风能</color>并造成<color=#e06a02>木属性伤害</color>，当<color=#e06a02>风能</color>不足时，转而造成较低的<color=#e06a02>物理伤害</color>。<color=#e06a02>风能</color>的初始值和上限值为<color=#e06a02>12</color>格。\n核心状态期间<color=#e06a02>点击</color>普攻按钮，天狐恋会回收双扇并<color=#e06a02>恢复全部</color>风能，随后重新扔出双扇追踪目标。\n\n<i>待补充<i>",},}, need_gold = 198000, need_item = {{20333,5,},{30182,6,},},},
	["100805_1"] = { id = 100805, level = 1, desc_info = {{"长按","<color=#e89e1d>长按</color>攻击按钮时，将进行蓄力，雷电之势持续在枪口聚集。",},},},
	["100806_1"] = { id = 100806, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>普通预警</color>时，该次攻击可被<color=#e06a02>闪避</color>。\n在该次攻击前按下<color=#e06a02>闪避按钮</color>可闪避本次攻击。\n成功闪避可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100807_1"] = { id = 100807, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>圆形预警</color>时，该次攻击可被<color=#e06a02>跳跃闪避</color>。\n在被攻击之前按下<color=#e06a02>跳跃按钮</color>可触发<color=#e06a02>跳跃闪避</color>，并可释放<color=#e06a02>跳跃反击</color>。\n<color=#e06a02>跳跃反击</color>能够对敌人造成大量伤害，并可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100808_1"] = { id = 100808, level = 1, desc_info = {{"绝技点数","<color=#e06a02>弱点槽</color>：<color=#e06a02>除五行绝技外</color>大多数攻击命中时，都可以<color=#e06a02>不同程度地</color>积累敌人的弱点槽。当敌人的弱点槽满时，敌人将进入<color=#e06a02>五行击破</color>状态，并且我方队伍会获得<color=#e06a02>1</color>点<color=#b52e20>绝技点数</color>。\n<color=#e06a02>绝技点数</color>：<color=#e06a02>绝技点数</color>是一种<color=#e06a02>全队共享</color>的资源。可以通过<color=#e06a02>积累满敌人的弱点槽/击败敌人</color>使队伍获得绝技点数，最多可积攒<color=#e06a02>3</color>点绝技点数。队伍中的角色可以通过消耗绝技点数，释放五行绝技。",},{"日相","<color=#e06a02>获得日相</color>：<color=#e06a02>角色普攻命中/位于队伍后台/处于非战斗状态下</color>将逐渐恢复日相；<color=#e06a02>闪避/跳跃反击</color>成功时，将直接获得<color=#e06a02>1</color>格日相。最多可积攒<color=#e06a02>3</color>格日相。\n<color=#e06a02>失衡</color>：被敌人命中时，将损失一定<color=#e06a02>日相</color>。",},{"月相","<color=#e06a02>获得月相</color>：角色<color=#e06a02>闪避/跳跃反击</color>成功时，获得<color=#e06a02>1</color>格月相；最多可积攒<color=#e06a02>3</color>格月相。月相可用于释放<color=#e06a02>月灵技能</color>。",},},},
	["100809_1"] = { id = 100809, level = 1, desc_info = {{ [2] = "天狐恋木属性伤害加成提升30%。",},},},
	["100851_1"] = { id = 100851, level = 1, desc_info = {{ [2] = "释放风场后，天狐恋会恢复225点耐力值，同时全队角色滑翔速度增加15%，持续15秒。",},}, fight_marks = {10081001,},},
	["100852_1"] = { id = 100852, level = 1, desc_info = {{ [2] = "天狐恋获得10%木属性伤害加成，且普攻可以造成木属性伤害。",},}, fight_attrs = {{57,1000,},}, fight_marks = {10081002,},},
	["100853_1"] = { id = 100853, level = 1, desc_info = {{ [2] = "天狐恋技能生成的风场范围扩大2/3，并且对处于法阵的敌人每秒共造成相当于攻击力200%的木属性伤害。",},}, fight_marks = {10081003,},},
	["100854_1"] = { id = 100854, level = 1, desc_info = {{ [2] = "「五行绝技-扇法匿风」的总伤害倍率提升15%。",},}, fight_marks = {10081004,},},
