	["100856_1"] = { id = 100856, level = 1, desc_info = {{ [2] = "被「五行绝技-扇法匿风」击飞的敌人会进入缓慢下落状态，持续4秒，期间受到的木属性伤害增加10%。",},}, fight_marks = {10081006,},},
