	["100906_1"] = { id = 100906, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>普通预警</color>时，该次攻击可被<color=#e06a02>闪避</color>。\n在该次攻击前按下<color=#e06a02>闪避按钮</color>可闪避本次攻击。\n成功闪避可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100907_1"] = { id = 100907, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>圆形预警</color>时，该次攻击可被<color=#e06a02>跳跃闪避</color>。\n在被攻击之前按下<color=#e06a02>跳跃按钮</color>可触发<color=#e06a02>跳跃闪避</color>，并可释放<color=#e06a02>跳跃反击</color>。\n<color=#e06a02>跳跃反击</color>能够对敌人造成大量伤害，并可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["100908_1"] = { id = 100908, level = 1, desc_info = {{"绝技点数","<color=#e06a02>弱点槽</color>：<color=#e06a02>除五行绝技外</color>大多数攻击命中时，都可以<color=#e06a02>不同程度地</color>积累敌人的弱点槽。当敌人的弱点槽满时，敌人将进入<color=#e06a02>五行击破</color>状态，并且我方队伍会获得<color=#e06a02>1</color>点<color=#b52e20>绝技点数</color>。\n<color=#e06a02>绝技点数</color>：<color=#e06a02>绝技点数</color>是一种<color=#e06a02>全队共享</color>的资源。可以通过<color=#e06a02>积累满敌人的弱点槽/击败敌人</color>使队伍获得绝技点数，最多可积攒<color=#e06a02>3</color>点绝技点数。队伍中的角色可以通过消耗绝技点数，释放五行绝技。",},{"日相","<color=#e06a02>获得日相</color>：<color=#e06a02>角色普攻命中/位于队伍后台/处于非战斗状态下</color>将逐渐恢复日相；<color=#e06a02>闪避/跳跃反击</color>成功时，将直接获得<color=#e06a02>1</color>格日相。最多可积攒<color=#e06a02>3</color>格日相。\n<color=#e06a02>失衡</color>：被敌人命中时，将损失一定<color=#e06a02>日相</color>。",},{"月相","<color=#e06a02>获得月相</color>：角色<color=#e06a02>闪避/跳跃反击</color>成功时，获得<color=#e06a02>1</color>格月相；最多可积攒<color=#e06a02>3</color>格月相。月相可用于释放<color=#e06a02>月灵技能</color>。",},},},
	["100909_1"] = { id = 100909, level = 1, desc_info = {{ [2] = "祁玉水属性伤害加成提升30%。",},},},
	["100951_1"] = { id = 100951, level = 1, desc_info = {{ [2] = "核心技能会额外释放一次跳踏，造成200%的伤害和治疗效果。",},}, fight_marks = {10091001,},},
	["100952_1"] = { id = 100952, level = 1, desc_info = {{ [2] = "祁玉获得15%治疗加成。",},}, fight_attrs = {{34,1500,},}, fight_marks = {10091002,},},
	["100953_1"] = { id = 100953, level = 1, desc_info = {{ [2] = "水环持续时间内，其余角色的普攻也可以累积祁玉的核心被动。",},}, fight_marks = {10091003,},},
	["100954_1"] = { id = 100954, level = 1, desc_info = {{ [2] = "「五行绝技-脉眼引·波澜」的总治疗倍率提升10%",},}, fight_marks = {10091004,},},
	["100955_1"] = { id = 100955, level = 1, desc_info = {{ [2] = "「五行绝技-脉眼引·波澜」每命中一个敌人，祁玉便会回复0.5格日相",},}, fight_marks = {10091005,},},
	["100956_1"] = { id = 100956, level = 1, desc_info = {{ [2] = "祁玉释放特技时，会为前台角色提供一个相当于祁玉生命值上限15%的护盾，护盾至多持续8秒。护盾被打破或者持续时间结束后，会爆炸并对周围的敌人造成祁玉生命值上限20%的水属性伤害。",},}, fight_marks = {10091006,},},
