	["101005_1"] = { id = 101005, level = 1, desc_info = {{"长按","<color=#e89e1d>长按</color>攻击按钮时，将进入断念状态。",},},},
	["101006_1"] = { id = 101006, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>普通预警</color>时，该次攻击可被<color=#e06a02>闪避</color>。\n在该次攻击前按下<color=#e06a02>闪避按钮</color>可闪避本次攻击。\n成功闪避可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["101007_1"] = { id = 101007, level = 1, desc_info = {{ [2] = "出现<color=#e06a02>圆形预警</color>时，该次攻击可被<color=#e06a02>跳跃闪避</color>。\n在被攻击之前按下<color=#e06a02>跳跃按钮</color>可触发<color=#e06a02>跳跃闪避</color>，并可释放<color=#e06a02>跳跃反击</color>。\n<color=#e06a02>跳跃反击</color>能够对敌人造成大量伤害，并可为角色回复<color=#e06a02>1</color>格<color=#e06a02>日相</color>和<color=#e06a02>月相</color>。",},},},
	["101008_1"] = { id = 101008, level = 1, desc_info = {{"绝技点数","<color=#e06a02>弱点槽</color>：<color=#e06a02>除五行绝技外</color>大多数攻击命中时，都可以<color=#e06a02>不同程度地</color>积累敌人的弱点槽。当敌人的弱点槽满时，敌人将进入<color=#e06a02>五行击破</color>状态，并且我方队伍会获得<color=#e06a02>1</color>点<color=#b52e20>绝技点数</color>。\n<color=#e06a02>绝技点数</color>：<color=#e06a02>绝技点数</color>是一种<color=#e06a02>全队共享</color>的资源。可以通过<color=#e06a02>积累满敌人的弱点槽/击败敌人</color>使队伍获得绝技点数，最多可积攒<color=#e06a02>3</color>点绝技点数。队伍中的角色可以通过消耗绝技点数，释放五行绝技。",},{"日相","<color=#e06a02>获得日相</color>：<color=#e06a02>角色普攻命中/位于队伍后台/处于非战斗状态下</color>将逐渐恢复日相；<color=#e06a02>闪避/跳跃反击</color>成功时，将直接获得<color=#e06a02>1</color>格日相。最多可积攒<color=#e06a02>3</color>格日相。\n<color=#e06a02>失衡</color>：被敌人命中时，将损失一定<color=#e06a02>日相</color>。",},{"月相","<color=#e06a02>获得月相</color>：角色<color=#e06a02>闪避/跳跃反击</color>成功时，获得<color=#e06a02>1</color>格月相；最多可积攒<color=#e06a02>3</color>格月相。月相可用于释放<color=#e06a02>月灵技能</color>。",},},},
	["101009_1"] = { id = 101009, level = 1, desc_info = {{"天赋","每次释放派生攻击使自身生命降低后，会获得10%的后台日相回复效率加成（再次上场时该效果失效）",},},},
