	["199903_1"] = { id = 199903, level = 1, desc_attr = {{"切割伤害","1140.00%",},{"绽放伤害","2660.00%",},}, desc_info = {{ [2] = "敌人<color=#dd4e2d>弱点槽</color>积累满时可选择释放。释放时，用全力汇聚烈火，向前方放出<color=#dd4e2d>坠火踏破</color>。\n忘记了本来绝技，只能粗暴将火焰乱作一团的战法。",},{"坠火踏破","·将狂舞的火焰直接压向前方，造成火属性伤害。\n·持续时间结束时爆发，造成火属性范围伤害。",},{"弱点槽","成功命中敌人都将积累敌人弱点槽：<color=#e89e1d>普攻</color>可<color=#e89e1d>小幅</color>积累敌人弱点槽；<color=#e89e1d>释放特技</color>或<color=#e89e1d>反击成功</color>（闪避反击、弹刀反击、跳跃反击）可<color=#e89e1d>中幅</color>积累敌人弱点槽；<color=#e89e1d>核心被动</color>可<color=#e89e1d>大幅</color>积累敌人弱点槽。\n敌人失衡：弱点槽满时，敌人将<color=#e89e1d>失衡眩晕</color>，此时可选择释放全队任意队员的<color=#e89e1d>五行绝技</color>。",},},},
